export function getRandomUserData() {
  let userData = []
  let picNums = [pic1, pic2, pic3, pic4, pic5, pic6, pic7, pic8, pic9, pic10, pic11, pic12, pic13, pic14, pic15, pic16, pic17, pic18, pic19, pic20]
  let usedIdxVals = []
  let randIdx
  function generateNewNum() {
    randIdx = Math.floor(Math.random() * users.length)
    if (usedIdxVals.includes(randIdx)) {
      generateNewNum()
    }
    usedIdxVals.push(randIdx)
  }
  for (let i = 1; i <= 20; i++) {
    let picIdx = Math.floor(Math.random() * picNums.length)
    generateNewNum()
    let tempObj = users[randIdx]
    tempObj.personal.profilePic = picNums[picIdx]
    picNums.splice(picIdx, 1)
    userData.push(users[randIdx])
  }
  return userData
}

export function getRandomUserDetails(userId, pic) {
  let userDetails = users.find(user => user._id === userId)
  userDetails.personal.profilePic = pic
  return userDetails
}